namespace Shine
{
	/** 返回搜索结果(generated by shine) */
	export class ReSearchPlayerResponse extends GameResponse
	{
		/** 数据类型ID */
		public static dataID:number=GameResponseType.ReSearchPlayer;
		
		/** 结果 */
		public contact:ContactData;
		
		constructor()
		{
			super();
			this._dataID=GameResponseType.ReSearchPlayer;
		}
		
		/** 获取数据类名 */
		public getDataClassName():string
		{
			return "ReSearchPlayerResponse";
		}
		
		/** 读取字节流(简版) */
		protected toReadBytesSimple(stream:BytesReadStream):void
		{
			super.toReadBytesSimple(stream);
			
			this.contact=stream.readDataSimpleNotNull() as ContactData;
			
		}
		
		/** 执行 */
		protected execute():void
		{
			
		}
		
	}
}
